import React from "react";
import './styles.css';

const Project=()=>{

    const projects = [
        {
            id: 1,
            title: "Class Catcher",
            description: "An application designed to assist Boston University students in finding and scheduling classes for future semesters, leverages a web scraper to extract information from 2,000+ courses in BU database, Google Calendar and Google Maps APIs., ensuring up-to-date and accurate data. Utilized React, Node.js, Flask, and SQLAlchemy to build and maintain the application, combining front-end and back-end technologies for a robust and user-friendly experience.",
            image: 'class-catcher.png',
            link: 'https://github.com/KyleYung/class-catcher'
        },

        {
            id: 2,
            title: "eCommerce Store Website",
            description: "blah blah blah",
            image: 'ecommerce.png',
            link: ''
        },

        {
            id: 3,
            title: "Tetris Neural Network",
            description: "blah blah blah",
            image: 'tetris.png',
            link: 'https://github.com/KyleYung/Tetris-Neural-Network'
        },

        {
            id: 4,
            title: "AI Chess Bot",
            description: "blah blah blah",
            image: 'chess.jpeg',
            link: 'https://github.com/KyleYung/AI-Chess-Bot'
        },

        {
            id: 5,
            title: "Travel Booking Site",
            description: "blah blah blah",
            image: 'journey.png',
            link: 'https://github.com/KyleYung/JOURNEY'
        },
    ];

    return (
        <div className="projects">
            <div className="projects-header">
                <h1 className="projects-title">My Projects</h1>
            </div>
            <div className="projects-grid">
                {projects.map((project) => (
                    <a href={project.link} target="_blank" rel="noopener noreferrer" className="project-link" key={project.id}>
                        <div className="project-card" key={project.id}>
                            <div className="project-card-image-container">
                                <img src={project.image} alt={project.title} className="project-card-image"/>
                                <div className="project-card-overlay"></div>
                            </div>
                            <h2 className="project-card-title">{project.title}</h2>
                            <p className="project-card-description">{project.description}</p>
                        </div>
                    </a>
                ))}
            </div>
        </div>
    )
}

export default Project;
